import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom";

const MerchantDashboard = () => {
  const { merchantId } = useParams();
  const navigate = useNavigate();
  const [merchantData, setMerchantData] = useState(null);
  const [isEditing, setIsEditing] = useState(false);
  const [profile, setProfile] = useState({
    businessName: "",
    description: "",
    services: [{ name: "", price: "" }],
  });

  // Fetch merchant data on mount
  useEffect(() => {
    const fetchMerchantData = async () => {
      const token = localStorage.getItem("authToken");
      try {
        const response = await axios.get(`http://localhost:5000/api/merchant/${merchantId}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setMerchantData(response.data);
        setProfile(response.data.businessDetails || { businessName: "", description: "", services: [] });
      } catch (error) {
        console.error("Error fetching merchant data:", error);
        if (error.response.status === 401) navigate("/auth");
      }
    };

    fetchMerchantData();
  }, [merchantId, navigate]);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/auth");
  };

  const handleEdit = () => {
    setIsEditing(true);
  };

  const handleSave = async () => {
    try {
      const token = localStorage.getItem("authToken");
      const response = await axios.put(
        `http://localhost:5000/api/merchant/${merchantId}`,
        profile,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setMerchantData(response.data);
      setIsEditing(false);
    } catch (error) {
      console.error("Error saving merchant data:", error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  return (
    <div className="p-8 bg-gray-100 h-screen">
      <header className="flex justify-between items-center bg-white p-4 shadow-md">
        <h1 className="text-xl font-bold">Merchant Dashboard</h1>
        <button
          onClick={handleLogout}
          className="px-4 py-2 bg-red-500 text-white rounded-md"
        >
          Logout
        </button>
      </header>

      {merchantData ? (
        <div className="mt-8">
          <h2 className="text-2xl font-bold">Welcome, {merchantData.name}</h2>
          <div className="mt-4 bg-white p-4 rounded-lg shadow-md">
            <h3 className="text-lg font-bold">Profile Details</h3>
            {isEditing ? (
              <div>
                <input
                  type="text"
                  name="businessName"
                  value={profile.businessName}
                  onChange={handleChange}
                  placeholder="Business Name"
                  className="mt-2 p-2 border border-gray-300 rounded"
                />
                <textarea
                  name="description"
                  value={profile.description}
                  onChange={handleChange}
                  placeholder="Business Description"
                  className="mt-2 p-2 border border-gray-300 rounded"
                />
                <button
                  onClick={handleSave}
                  className="mt-4 px-4 py-2 bg-blue-500 text-white rounded"
                >
                  Save
                </button>
              </div>
            ) : (
              <div>
                <p><strong>Business Name:</strong> {merchantData.businessDetails?.businessName || "Not Set"}</p>
                <p><strong>Description:</strong> {merchantData.businessDetails?.description || "Not Set"}</p>
                <button
                  onClick={handleEdit}
                  className="mt-4 px-4 py-2 bg-green-500 text-white rounded"
                >
                  Edit Profile
                </button>
              </div>
            )}
          </div>
        </div>
      ) : (
        <p>Loading profile...</p>
      )}
    </div>
  );
};

export default MerchantDashboard;
